import { Link } from "react-router-dom";

const EVENTS = [
    {id: 'ev1', title:'Event 1'},
    {id: 'ev1', title:'Event 2'},
]
function EventsPage() {
    return <>
    <h1>EventsPage</h1>
        <ul>
            {EVENTS.map((event) => (
                <li>
                    <Link to="/events/{eventID}">{event.title}</Link>
                </li>
            ))}
        </ul>
    </>
} export default EventsPage;
